}

* {
    font-family: 'Poppins', 'Open Sans', 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif !important;

    &::selection {
        background: $moderateBlue;
    }
}

.container-fluid {
    max-width: 1700px;
}

.color-gold {
    color: $goldSunray;


}

a.color-gold {

    &:hover,
    &:focus {
        color: $goldSunray;
    }
}

.header {
    position: relative;
    width: 100%;
}

.navbar {
    height: 80px;
    padding: 0px 75px;
    z-index: 5;
    position: fixed;
    width: 100%;
    z-index: 3;
    transition: 0.3s;
    top: 0;
    left: 0;

    &-brand {
        color: $blackSpace;
        font-weight: 800;
        transition: 0.2s;

        .img-fluid {
            height: 50px;
            max-height: 50px;
            max-width: 100%;
        }

        &:focus,
        &:hover {
            color: $goldSunray;
        }
    }

    &-nav li a {
        transition: 0.2s;
    }

    &-nav li:hover a,
    &-nav li.active a {
        color: $goldSunray;
    }


    &-nav li:hover a {
        transform: translateY(-0.25rem);
    }


    &-nav .nav-item:not(:last-of-type) {
        margin-right: 50px;
    }

    &-nav .nav-link {
        color: $blackSpace;
        font-size: 19px;
    }


    &-toggler {
        padding: .25rem 0;
        border: 0;

        //resetting bootstrap outline
        &:active,
        &:focus,
        &:hover {
            outline-color: transparent !important;
            outline: none;
            -webkit-tap-highlight-color: transparent;
            -webkit-appearance: none;
            -webkit-focus-ring-color: none;
            box-shadow: none;
        }
    }

    &__burger {
        width: 2.5rem;
        height: 2rem;
        position: relative;
        cursor: pointer;
        transform: scale(0.7);



        span {
            display: block;
            position: absolute;
            height: calc(25% - 0.3rem);
            width: 100%;
            background-color: whitesmoke;
            border-radius: 1px;
            opacity: 1;
            left: 0;
            top: 0;
            transition: 0.3s;

            &:nth-child(2) {
                transform-origin: center;
                transform: rotate(45deg);
                top: 25%;
            }

            &:nth-child(3) {
                transform-origin: center;
                transform: rotate(-45deg);
                top: 25%;
            }

            &:nth-child(1) {
                transform-origin: top left;
                transform: rotate(45deg);
                opacity: 0;
            }

            &:nth-child(4) {
                transform-origin: bottom right;
                transform: rotate(-45deg);
                opacity: 0;
            }


        }
    }

    // .collapsed span:nth-child(3) {
    //     width: 75%;
    // }

    .collapsed {
        span {
            display: block;
            position: absolute;
            height: calc(25% - 0.3rem);
            width: 100%;
            background-color: whitesmoke;
            border-radius: 1px;
            opacity: 1;
            left: 0;
            top: 0;
            transition: 0.3s;
            transform: none;

            &:nth-child(2) {
                top: 25%;
                transform: none;
            }

            &:nth-child(3) {
                top: 50%;
                transform: none;
            }

            &:nth-child(4) {
                top: 75%;
                transform: none;
            }
        }
    }
}



.main {
    background: $blackSpace;

    .container {
        // background-color: white;
        font-size: 14px;
        line-height: 26px;
        color: $goldSunray;
    }
}


.hero {
    margin-top: 80px;
    background: $greyIsabeline;

    &__background {
        height: 100vh;
        object-fit: cover;
    }

    &__heading,
    &__subheading {
        font-family: 'Poppins', sans-serif;
        font-weight: 800;
        letter-spacing: 0.45px;
        color: $goldSunray;
        position: relative;
        z-index: 0;
        font-size: 6vmin;
    }

    &__subheading {
        font-size: 3vmin;
        color: $blackSpace;
    }

    &__input {
        &:focus {
            border-color: lighten($color: $goldSunray, $amount: 20%);
            box-shadow: 0 0 0 0.2rem rgba(222, 166, 74, .25);

        }
    }

    &__submit {
        background-color: $goldSunray;
        border-color: $goldSunray;
    }
}


.features {
    background: $blackSpace;
    position: relative;
    color: $goldSunray;
    min-height: 500px;

    &__text {
        color: $goldSunray;
    }

    &__item {
        padding: 0 1rem;
        display: flex;
        justify-content: center;
        align-items: center;
    }

    &__heading {
        color: $goldSunray;
        font-weight: 800;
    }

    &__subheading {
        font-size: $font-size-big;
        max-width: 700px;
        margin: auto;
        text-align: center;
        color: $goldSunray;
    }


    &__check-mark {
        height: 3rem;
        max-width: 3rem;
    }

    &__text {
