        justify-content: space-between;
        background-color: darken($color: $blackSpace, $amount: 5%);
        padding: 0.45rem 1.5rem;
        color: $greyIsabeline;
        opacity: 0.8;
        // flex: 2 0 25%;

        // &:nth-child(even) {
        //     background: $greyIsabeline;
        // }



        &-name {
            // float: left;
            // width: 65%;
        }

        &-price {
            // float: right;
            // width: 35%;
            // text-align: right;
            // font-weight: 600;

        }
    }

    &__grid {
        display: grid;
        grid-template-columns: 1fr 1fr 1fr 1fr;
        color: $blackSpace;

        &--double {
            grid-template-columns: 1fr 1fr;
        }
    }
}


.contact {
    padding-top: 10rem;

    &__subheading {
        color: $goldSunray;
        font-style: italic;
    }

    &__discord-link {
        background: $goldSunray;
        border: $goldSunray;
        outline: $goldSunray;
        transition: 0.3s;
        letter-spacing: 0.5px;

        &:hover,
        &:active {
            border: $goldSunray;
            outline: $goldSunray;
