            box-shadow: none;
        }

        &:focus {
            background: $goldSunray;
            border: $goldSunray;
            outline: $goldSunray;
            background: $goldSunray;
            box-shadow: none;
        }

        &:hover {
            transform: scale(1.1);
        }

        &:active {
