        }
    }

}

.about,
.recruit {
    padding-top: 150px;

    &__intro {
        color: $goldSunray;
        text-align: justify;
        font-size: initial;
    }

    &__note {
        opacity: 0.5;
        max-height: 40vh;
    }

    &__item {
        transition: 0.3s;
        color: $goldSunray;
        padding-bottom: 100px;

        &-heading {
            font-weight: 600;
            font-size: $font-size-big;
        }

        &-description {
            transition: 0.3s;
            color: $goldSunray;
            text-align: justify;
        }

        &-date {
            border-right: 2px solid $goldSunray;
            font-size: $font-size-big;
        }


    }
}

.recruit {
    &__subheading {
        color: $goldSunray;
        font-size: 1.25rem;
        font-family: 'Open Sans', 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif !important;
        text-shadow: none;
    }

    &__intro {
        color: $goldSunray;
    }

    &__form-label {
        font-size: 0.75rem;
        line-height: 1;
        margin-bottom: 0.25rem;
        margin-top: 3.5rem;
    }

    &__form-input,
    &__form-textarea {
        outline: none;
        box-shadow: none;
        border: none;
        border-bottom: 1px solid $goldSunray;
        background: transparent;
        display: block;
        color: white;
        width: 100%;
        max-width: 100%;

        &:hover,
        &:focus {
            background: lighten($color: $blackSpace, $amount: 1%);
        }
    }

    &__form-textarea {
        background: lighten($color: $blackSpace, $amount: 1%);
        height: 100%;
        padding: 1rem;
    }

    &__form-submit {
        background: $goldSunray;
        color: $blackSpace;
        border: none;
        padding: 0.5rem 3rem;
        font-size: initial;
        transition: 0.3s;

        &:hover {
            transform: scale(1.1);
        }

        &:active {
            transform: scale(1);
        }
    }
}

.calendar {
    padding-top: 200px;
}

.eventsMaker {
    .select2-container {
        display: block;
        width: 100% !important;
    }

    .select2-container--default .select2-selection--single {
        background: transparent;
        border: none;
        border-bottom: 1px solid $goldSunray;
        border-radius: 0;
        width: 100%;
    }

    .select2-container--default .select2-selection--single .select2-selection__rendered {
        color: white;
    }

    .select2-selection__rendered:focus {
        box-shadow: none;
        outline: none;
    }

    .select2-dropdown,
    span.select2-dropdown.select2-dropdown--below {
        background: $blackSpace;

    }


}

.footer {
    background-color: $blackSpace;
    text-align: center;
    color: $goldSunray;
    font-size: 0.75rem;
    padding-top: 30vh;
    margin-top: -1px;

    &__copyright {
        border-top: 1px solid $goldSunray;
    }
}

@media (max-width:992px) {

    .header {
        &::before {
            background: rgba(0, 0, 0, 0.8);
        }
    }

    .navbar {
        background-color: black;
        padding: 0 1rem;
        height: 60px;
        border-bottom: none;

        &-collapse {
            position: absolute;
            top: 60px;
            width: 100%;
            left: 0;
            z-index: 1;
            padding: 1rem;
            background-color: black;
        }
    }

    .navbar-brand {
        padding: 0;
    }

    .navbar-brand .img-fluid {
        max-height: 40px;
    }


    .hero {
        margin-top: 0;
        height: calc(100vh - 60px);

        &__background {
            height: calc(100vh - 40px);
        }
    }

    .pricing {
        .option:nth-child(even) {
            background-color: darken($color: $blackSpace, $amount: 8%);
        }
    }

    .features {
        .lute {
            transform: scale(0.7) translateX(5%);
        }
    }
}

@media (min-width:992px) {


    .pricing__grid {

        .option:nth-child(8n+2),
        .option:nth-child(8n+4),
        .option:nth-child(8n+5),
        .option:nth-child(8n+7) {
            background-color: darken($color: $blackSpace, $amount: 8%);
        }
    }

    .pricing__grid--double {

        .option:nth-child(8n+2),
        .option:nth-child(8n+4),
        .option:nth-child(8n+5),
        .option:nth-child(8n+7) {
            background-color: darken($color: $blackSpace, $amount: 5%);
        }

        .option:nth-child(4n+2),
        .option:nth-child(4n-1) {

            background-color: darken($color: $blackSpace, $amount: 8%);
        }
    }


}

@keyframes arrow {
    0% {
        transform: translateY(-20px);
        opacity: 0;
    }

    25% {
        transform: translateY(0);
        opacity: 1;
    }

    75% {
        transform: translateY(0);
        opacity: 1;
    }

    100% {
        transform: translateY(20px);
        opacity: 0;
    }
}
